import '../styles/deleteButton.css';
import { CiTrash } from "react-icons/ci";


interface DeleteButtonProps {
    onClick ? () : void;
}

const DeleteButton = ({
    onClick
}: DeleteButtonProps) => {
    return (
        <>
        <div className="deleteButtonContainer" onClick={ onClick }>
            < CiTrash />
        </div>
        </>
    );
}

export default DeleteButton;
